import React, { Component } from "react";
import Wordtile from "./wordtile";

class Wordtiles extends Component {
    render() {
        const { wordtiles} =
        this.props;

        return (
        <div>
            {Array.from(wordtiles).map((wordtile) => (
            <Wordtile
                key={wordtile.id}
                src={wordtile}
            />
            ))}
        </div>
        );
    }
}

export default Wordtiles;
